import { useState } from 'react';
import { Outlet } from 'react-router-dom';
export default function Page()  {
  const [num, setNum] = useState(0);
  return (
    <>
      <div>Header</div>
      <div>{num}</div>
      <div onClick={(val) => setNum(val + 1)}></div>
      {/* 使用 <Outlet />组件 配置 二级路由 渲染位置（二级路由出口）； */}
      <Outlet />
    </>
  )
}
